CREATE TABLE sqlite_sequence(name,seq);
CREATE TABLE song (song_id INTEGER PRIMARY KEY AUTOINCREMENT, title VARCHAR (500), date_last_modified INTEGER DEFAULT (datetime('now')));
CREATE TABLE show_song (show_song_id INTEGER PRIMARY KEY AUTOINCREMENT, show_id INTEGER REFERENCES show (show_id), song_id INTEGER REFERENCES song (song_id), track_number DECIMAL, date_last_modified INTEGER DEFAULT (datetime('now')), modifier VARCHAR (200));
CREATE TABLE show (show_id INTEGER PRIMARY KEY AUTOINCREMENT, date STRING, venue VARCHAR (500), city VARCHAR (500), state VARCHAR (100), date_last_modified INTEGER DEFAULT (datetime('now')), artist VARCHAR (50));
CREATE TABLE meta (meta_id INTEGER PRIMARY KEY AUTOINCREMENT, meta_key VARCHAR (200), meta_value VARCHAR (200));
CREATE TRIGGER SONG_update_date_last_modified AFTER UPDATE OF title ON song FOR EACH ROW BEGIN UPDATE song 
SET date_last_modified=datetime('now') 
WHERE song_id=OLD.song_id; END;
CREATE TRIGGER SHOW_SONG_update_date_last_modified AFTER UPDATE OF show_id, song_id, track_number, modifier ON show_song FOR EACH ROW BEGIN UPDATE show 
SET date_last_modified=datetime('now') 
WHERE show_song_id=NEW.show_song_id; END;
CREATE TRIGGER SHOW_update_date_last_modified AFTER UPDATE OF date, venue, city, state, artist ON show FOR EACH ROW BEGIN UPDATE show 
SET date_last_modified=datetime('now')
WHERE show_id=NEW.show_id; END;
CREATE VIEW database_last_modified AS SELECT MAX(date) as database_last_modified
FROM (
    SELECT MAX(date_last_modified) AS date from song
    UNION ALL
    SELECT MAX(date_last_modified) AS date from show
    UNION  ALL
    SELECT MAX(date_last_modified) AS date from show_song
)
/* database_last_modified(database_last_modified) */;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE song (song_id INTEGER PRIMARY KEY AUTOINCREMENT, title VARCHAR (500), date_last_modified INTEGER DEFAULT (datetime('now')));
CREATE TABLE show_song (show_song_id INTEGER PRIMARY KEY AUTOINCREMENT, show_id INTEGER REFERENCES show (show_id), song_id INTEGER REFERENCES song (song_id), track_number DECIMAL, date_last_modified INTEGER DEFAULT (datetime('now')), modifier VARCHAR (200));
CREATE TABLE show (show_id INTEGER PRIMARY KEY AUTOINCREMENT, date STRING, venue VARCHAR (500), city VARCHAR (500), state VARCHAR (100), date_last_modified INTEGER DEFAULT (datetime('now')), artist VARCHAR (50));
CREATE TABLE meta (meta_id INTEGER PRIMARY KEY AUTOINCREMENT, meta_key VARCHAR (200), meta_value VARCHAR (200));
DELETE FROM sqlite_sequence;
CREATE TRIGGER SONG_update_date_last_modified AFTER UPDATE OF title ON song FOR EACH ROW BEGIN UPDATE song 
SET date_last_modified=datetime('now') 
WHERE song_id=OLD.song_id; END;
CREATE TRIGGER SHOW_SONG_update_date_last_modified AFTER UPDATE OF show_id, song_id, track_number, modifier ON show_song FOR EACH ROW BEGIN UPDATE show 
SET date_last_modified=datetime('now') 
WHERE show_song_id=NEW.show_song_id; END;
CREATE TRIGGER SHOW_update_date_last_modified AFTER UPDATE OF date, venue, city, state, artist ON show FOR EACH ROW BEGIN UPDATE show 
SET date_last_modified=datetime('now')
WHERE show_id=NEW.show_id; END;
CREATE VIEW database_last_modified AS SELECT MAX(date) as database_last_modified
FROM (
    SELECT MAX(date_last_modified) AS date from song
    UNION ALL
    SELECT MAX(date_last_modified) AS date from show
    UNION  ALL
    SELECT MAX(date_last_modified) AS date from show_song
);
COMMIT;
