INSERT INTO show_song VALUES(12458,619,350,9,'2021-11-29 22:52:17','During the section of I Didn''t Know where Fish usually does some sort of solo, Page asked everyone who had been there the night before how they liked the encore. Trey and Mike put their microphones in the same position as they were for BBFCFM, and Page brought people on stage to give testimonials about how they felt about it. "Special guests" included Brad Sands, Paul Languedoc (who played a clip of Sex Pistols'' Holiday in the Sun) and Chris Kuroda. Trey admitted his guilt in the mishap and the song continued. ');
